import { List, ListItem } from '@chakra-ui/react';

const FileUploadList = () => {
    return (
        <List>
            <ListItem>Uploaded File 1</ListItem>
            <ListItem>Uploaded File 2</ListItem>
        </List>
    );
};

export default FileUploadList;
